//! ClickHouse function validation.
//!
//! Contains the function catalog (auto-generated from clickhouse-functions.jsonl)
//! and ClickHouse-specific validation logic like aggregate combinator handling.

use super::{FunctionCatalog, FunctionSignature};
use std::sync::LazyLock;

/// ClickHouse aggregate function combinator suffixes.
///
/// Any aggregate function can be combined with these suffixes to create derived
/// functions (e.g., `sum` + `If` = `sumIf`, `count` + `State` = `countState`).
/// See: https://clickhouse.com/docs/en/sql-reference/aggregate-functions/combinators
pub const COMBINATORS: &[&str] = &[
    "If",
    "Array",
    "Map",
    "State",
    "Merge",
    "MergeState",
    "ForEach",
    "Distinct",
    "OrDefault",
    "OrNull",
    "Resample",
    "ArgMin",
    "ArgMax",
];

/// The global ClickHouse function catalog, initialized once on first access.
///
/// Auto-generated from: tools/clickhouse-extract/clickhouse-functions.jsonl (1544 functions, 196 aliases)
///
/// To regenerate:
///   python3 tools/clickhouse-extract/generate-function-catalog.py
